using Microsoft.AspNetCore.Mvc;
using System;
using EventPlanner.Data;
using System.Linq;
using Microsoft.EntityFrameworkCore;
using System.Threading.Tasks;
using System.Collections.Generic;
using System.Text;
using EventPlanner.Models;
using System.Globalization;
using System.Text.RegularExpressions;

namespace EventPlanner.Controllers
{
    [Route("api/[controller]")]
    [ApiController]
    public class ReportsController : ControllerBase
    {
        private readonly ApplicationDbContext _context;

        public class Report
        {
            public string Html { get; set; }
        }

        public ReportsController(ApplicationDbContext context)
        {
            _context = context;
        }

        [HttpGet("budget-form/{eventId}")]
        public async Task<ActionResult<Report>> GetBudgetForm(Guid eventId)
        {
            var @event = await _context.Events.FindAsync(eventId);
            var guestCount = await _context.Guests.Where(g => g.Event.Id == eventId).CountAsync();
            var suppliers = await _context.Suppliers
            .Include(s => s.Type)
            .Where(s => s.Event.Id == eventId).ToListAsync();

            string html = @"
<!DOCTYPE html>
<html>
    <head>
        <title>Budget Form</title>
    </head>
    <body>
        <table id='suppliers'>
            <thead>
                <tr>
                    <td colspan='11' class='header'>{0}</td>
                </tr>
                <tr>
                    <th>Supplier</th>
                    <th>Company</th>
                    <th>Contact Person</th>
                    <th>Package Price</th>
                    <th>Discount</th>
                    <th>1st Down Payment</th>
                    <th>2nd Down Payment</th>
                    <th>3rd Down Payment</th>
                    <th>Total Down</th>
                    <th>Balance</th>
                    <th>Remarks</th>
                </tr>
            </thead>
            <tbody>
                {1}
            </tbody>
            <tfoot>
                {2}
            </tfoot>
        </table>
    </body>
</html>
";
            string header = "";
            string footer = "";
            StringBuilder strBuilder = new StringBuilder();

            if (@event is Wedding)
            {
                var wedding = @event as Wedding;
                strBuilder.Append($"<strong>Bride:</strong> {wedding.BrideName} ");
                strBuilder.Append($"<strong>Groom:</strong> {wedding.GroomName} ");
                strBuilder.Append($"<strong>Date:</strong> {@event.Date.ToLongDateString()} ");
                strBuilder.Append($"<strong>CeremonyVenue:</strong> {wedding.CeremonyVenue} ");
                strBuilder.Append($"<strong>CeremonyTime:</strong> {wedding.CeremonyTime} ");
                strBuilder.Append($"<strong>ReceptionVenue:</strong> {wedding.ReceptionVenue} ");
                strBuilder.Append($"<strong>ReceptionTime:</strong> {wedding.ReceptionTime} ");
                strBuilder.Append($"<strong>Guest#:</strong> {guestCount} ");
            }
            else
            {
                strBuilder.Append($"<strong>Celebrant/s:</strong> {@event.Celebrant} ");
                strBuilder.Append($"<strong>Date:</strong> {@event.Date.ToLongDateString()} ");
                strBuilder.Append($"<strong>Guest#:</strong> {guestCount} ");
            }

            header = strBuilder.ToString();
            strBuilder.Clear();

            IList<string> contents = new List<string>();

            foreach (var s in suppliers)
            {
                strBuilder = new StringBuilder();
                strBuilder.Append("<tr>");
                strBuilder.Append($"<td>{s.Type.Name}</td>");
                strBuilder.Append($"<td>{s.Name}</td>");
                strBuilder.Append($"<td>{s.ContactPerson}</td>");
                strBuilder.Append($"<td>{s.PackagePrice.ToString("C2", CultureInfo.CurrentCulture)}</td>");
                strBuilder.Append($"<td>{s.Discount.ToString("C2", CultureInfo.CurrentCulture)}</td>");
                strBuilder.Append($"<td>{s.FirstDownPayment.ToString("C2", CultureInfo.CurrentCulture)}</td>");
                strBuilder.Append($"<td>{s.SecondDownPayment.ToString("C2", CultureInfo.CurrentCulture)}</td>");
                strBuilder.Append($"<td>{s.ThirdDownPayment.ToString("C2", CultureInfo.CurrentCulture)}</td>");
                strBuilder.Append($"<td>{s.TotalDown.ToString("C2", CultureInfo.CurrentCulture)}</td>");
                strBuilder.Append($"<td>{s.Balance.ToString("C2", CultureInfo.CurrentCulture)}</td>");
                strBuilder.Append($"<td>{s.Remarks}</td>");
                strBuilder.Append("</tr>");

                contents.Add(strBuilder.ToString());
            }

            strBuilder.Clear();
            strBuilder.Append("<tr>");
            strBuilder.Append($"<td>Total</td>");
            strBuilder.Append($"<td></td>");
            strBuilder.Append($"<td></td>");
            strBuilder.Append($"<td>{suppliers.Sum(s => s.PackagePrice).ToString("C2", CultureInfo.CurrentCulture)}</td>");
            strBuilder.Append($"<td>{suppliers.Sum(s => s.Discount).ToString("C2", CultureInfo.CurrentCulture)}</td>");
            strBuilder.Append($"<td>{suppliers.Sum(s => s.FirstDownPayment).ToString("C2", CultureInfo.CurrentCulture)}</td>");
            strBuilder.Append($"<td>{suppliers.Sum(s => s.SecondDownPayment).ToString("C2", CultureInfo.CurrentCulture)}</td>");
            strBuilder.Append($"<td>{suppliers.Sum(s => s.ThirdDownPayment).ToString("C2", CultureInfo.CurrentCulture)}</td>");
            strBuilder.Append($"<td>{suppliers.Sum(s => s.TotalDown).ToString("C2", CultureInfo.CurrentCulture)}</td>");
            strBuilder.Append($"<td>{suppliers.Sum(s => s.Balance).ToString("C2", CultureInfo.CurrentCulture)}</td>");
            strBuilder.Append($"<td></td>");
            strBuilder.Append("</tr>");
            footer = strBuilder.ToString();

            var fullHtml = string.Format(html, header, string.Join(' ', contents), footer);

            return new Report { Html = fullHtml };
        }

        [HttpGet("checklist/{eventId}")]
