            var @event = await _context.Events.Include(e => e.Type).FirstAsync(e => e.Id == eventId);
            var suppliers = await _context.Suppliers
            .Include(s => s.Type)
            .Where(s => s.Event.Id == eventId).ToListAsync();

            string html = @"
<!DOCTYPE html>
<html>
<head>
    <title>Checklist</title>
    </style>
</head>
<body onload='window.print()'>
    <div id='checklist-header'>
        <img class='logo' src='{0}'/>
        <h2 class='title'>WEDDINGS & MOTIFS EVENT CHECK LIST</h2>
    </div>
    <table id='checklist'>
        <tbody>
            {1}
        </tbody>
    </table>
</body>
</html>
";
            IList<string> contents = new List<string>();
            StringBuilder strBuilder = new StringBuilder();
            string imgSrc = "data:image/png;base64,";

            strBuilder.Append("<tr>");
            strBuilder.Append("<td>");
            strBuilder.Append("<strong>Name of Celebrant/s</strong>");
            strBuilder.Append("</td>");
            strBuilder.Append("<td>");
            strBuilder.Append(@event.Celebrant);
            strBuilder.Append("</td>");
            strBuilder.Append("<td>");
            strBuilder.Append($"<strong>Event Date:</strong> {@event.Date.ToLongDateString()}");
            strBuilder.Append("</td>");
            strBuilder.Append("</tr>");
            contents.Add(strBuilder.ToString());
            strBuilder.Clear();

            strBuilder.Append("<tr>");
            strBuilder.Append("<td>");
            strBuilder.Append("<strong>Type of Event</strong>");
            strBuilder.Append("</td>");
            strBuilder.Append("<td>");
            strBuilder.Append(@event.Type.Name);
            strBuilder.Append("</td>");
            strBuilder.Append("<td>");
            strBuilder.Append($"<strong>Package:</strong> {@event.Package}");
            strBuilder.Append("</td>");
            strBuilder.Append("</tr>");
            contents.Add(strBuilder.ToString());
            strBuilder.Clear();

            foreach (var s in suppliers)
            {
                strBuilder.Append("<tr>");
                strBuilder.Append("<td>");
                strBuilder.Append($"<strong>{s.Type.Name}</strong>");
                strBuilder.Append("</td>");
                strBuilder.Append("<td>");
                strBuilder.Append($"Supplier: {s.Name}");
                strBuilder.Append("</td>");
                strBuilder.Append("<td>");
                strBuilder.Append($"<strong>Contact Person:</strong> {s.ContactPerson}");
                strBuilder.Append($"<br/><strong>Mobile no.:</strong> {s.Mobile}");
                strBuilder.Append($"<br/><strong>Email Add:</strong> {s.Email}");
                strBuilder.Append("</td>");
                strBuilder.Append("</tr>");

                contents.Add(strBuilder.ToString());
                strBuilder.Clear();
            }

            return new Report { Html = string.Format(html, imgSrc, string.Join(' ', contents)) };
        }

        [HttpGet("program/{eventId}")]
        public async Task<ActionResult<Report>> GetProgram(Guid eventId)
        {
            var @event = await _context.Events
                .Include(e => e.Plan).ThenInclude(p => p.Parts)
                .FirstAsync(e => e.Id == eventId);

            _context.Entry(@event).State = EntityState.Detached;

            foreach (var p in @event.Plan.Parts)
                p.Steps = await _context.PlanSteps.Where(s => s.PlanPart.Id == p.Id).ToListAsync();

            string html = @"
<!DOCTYPE html>
<html>
<head>
    <title>Checklist</title>
</head>
<body>
    <table id='plan'>
        <thead>
            <tr>
                <th colspan='4'><img src='{0}' /></th>
            </tr>
        </thead>
        <tbody>
            {1}
            {2}
        </tbody>
    </table>
</body>
</html>
";
            string eventData = "";
            IList<string> contents = new List<string>();
            StringBuilder strBuilder = new StringBuilder();
            string imgSrc = "data:image/png;base64,";

            if (@event is Wedding)
            {
                var wedding = @event as Wedding;
                strBuilder.Append("<tr>");
                strBuilder.Append("<td style='text-align: right'><strong>Groom: </strong></td>");
                strBuilder.Append($"<td>&ensp;{wedding.GroomName}</td>");
                strBuilder.Append("<td style='text-align: right'><strong>Bride: </strong></td>");
                strBuilder.Append($"<td>&ensp;{wedding.BrideName}</td>");
                strBuilder.Append("</tr>");
                strBuilder.Append("<tr>");
                strBuilder.Append("<td style='text-align: right'><strong>Event Date: </strong></td>");
                strBuilder.Append($"<td>&ensp;{wedding.Date.ToLongDateString()}</td>");
                strBuilder.Append("<td style='text-align: right'><strong>Point Person: </strong></td>");
                strBuilder.Append("</tr>");
                strBuilder.Append("<tr>");
                strBuilder.Append("<td style='text-align: right'><strong>Church and Time: </strong></td>");
                strBuilder.Append($"<td>&ensp;{wedding.CeremonyVenue} {wedding.CeremonyTime}</td>");
                strBuilder.Append("<td style='text-align: right'><strong>Reception and Time: </strong></td>");
                strBuilder.Append($"<td>&ensp;{wedding.ReceptionVenue} {wedding.ReceptionTime}</td>");
                strBuilder.Append("</tr>");
            }
            else
            {
                strBuilder.Append("<tr>");
                strBuilder.Append("<td style='text-align: right'><strong>Celebrant/s: </strong></td>");
                strBuilder.Append($"<td>&ensp;{@event.Celebrant}</td>");
                strBuilder.Append("<td style='text-align: right'><strong>Event Date: </strong></td>");
                strBuilder.Append($"<td>&ensp;{@event.Date.ToLongDateString()}</td>");
                strBuilder.Append("</tr>");
            }

            eventData = strBuilder.ToString();
            strBuilder.Clear();

            contents.Add($"<tr><td colspan='4'><h1 class='plan-title'>{@event.Plan.Title}</h1></td></tr>");
            foreach (var p in @event.Plan.Parts.OrderBy(pr => pr.Index))
            {
                contents.Add($"<tr><td colspan='4'><h2 class='part-title'>{p.Title}</h2></td></tr>");
                foreach (var s in p.Steps.OrderBy(st => st.Index))
                {
                    contents.Add($"<tr><td colspan='4'><p><strong>{s.Index}. {s.Title}:</strong></p>");
                    contents.Add($"<div>{s.Description}</div></td></tr>");
                }
            }

            return new Report { Html = string.Format(html, imgSrc, eventData, string.Join(' ', contents)) };
        }

        [HttpGet("guest-list/{eventId}")]
        public async Task<ActionResult<Report>> GetGuestList(Guid eventId)
        {
            var @event = await _context.Events
                .Include(e => e.Type)
                .Include(e => e.Guests)
                .FirstAsync(e => e.Id == eventId);

            string html = @"
<!DOCTYPE html>
<html>
<head>
    <title>Checklist</title>
    </style>
</head>
<body onload='window.print()'>
    <div id='checklist-header'>
        <img class='logo' src='{0}'/>
        <h2 class='title'>WEDDINGS & MOTIFS EVENT GUEST LIST</h2>
    </div>
    <table id='guest-list'>
        <tbody>
            {1}
        </tbody>
    </table>
</body>
</html>
";
            IList<string> contents = new List<string>();
            StringBuilder strBuilder = new StringBuilder();
            string imgSrc = "data:image/png;base64,";

            strBuilder.Append("<tr>");
            strBuilder.Append("<td>");
            strBuilder.Append("<strong>Name of Celebrant/s</strong>");
            strBuilder.Append("</td>");
            strBuilder.Append("<td>");
            strBuilder.Append(@event.Celebrant);
            strBuilder.Append("</td>");
            strBuilder.Append("<td>");
            strBuilder.Append($"<strong>Event Date:</strong> {@event.Date.ToLongDateString()}");
            strBuilder.Append("</td>");
            strBuilder.Append("</tr>");
            contents.Add(strBuilder.ToString());
            strBuilder.Clear();

            strBuilder.Append("<tr>");
            strBuilder.Append("<td>");
            strBuilder.Append("<strong>Type of Event</strong>");
            strBuilder.Append("</td>");
            strBuilder.Append("<td>");
            strBuilder.Append(@event.Type.Name);
            strBuilder.Append("</td>");
            strBuilder.Append("<td>");
            strBuilder.Append($"<strong>Package:</strong> {@event.Package}");
            strBuilder.Append("</td>");
            strBuilder.Append("</tr>");
            contents.Add(strBuilder.ToString());
            strBuilder.Clear();

            contents.Add("<tr><td colspan='3'>Guests</td></tr>");
            contents.Add("<tr style='background-color: black; color: white'>");
            contents.Add("<td>Name</td>");
            contents.Add("<td>Contact Info</td>");
            contents.Add("<td>Attend</td>");
            contents.Add("</tr>");

            foreach (var g in @event.Guests)
            {
                strBuilder.Append("<tr>");
                strBuilder.Append("<td>");
                strBuilder.Append($"{g.Name}");
                strBuilder.Append("</td>");
                strBuilder.Append("<td>");
                strBuilder.Append($"<strong>Email:</strong> {g.Email} <strong>Mobile:</strong> {g.Mobile}");
                strBuilder.Append("</td>");
                strBuilder.Append("<td>");
                strBuilder.Append(g.WillAttend.HasValue ? g.WillAttend.Value ? "YES" : "NO" : "N/A");
                strBuilder.Append("</td>");
                strBuilder.Append("</tr>");

                contents.Add(strBuilder.ToString());
                strBuilder.Clear();
            }

            return new Report { Html = string.Format(html, imgSrc, string.Join(' ', contents)) };
        }
    }
}